description:
And here is a little gem from Alice...Geeks.

A Geek is a stereotype passionate about, or even obsessed with, computers, science fiction, animation, heroic fantasy, role playing games, video games, or perhaps all of the above. They wear T-shirts with strange logos, speak a language incomprehensible to mere mortals, feed mainly on that which can be ordered online, and would rather spend an evening upgrading their computers than going out with friends... Fred is a Geek and, all things considered, his life is pretty great. This special was compiled using gags from several volumes of Thomas Labourot's 'Les Geeks'.
